import p13_img from "./product-13.jpeg";
import p14_img from "./product-14.jpeg";
import p15_img from "./product-15.jpeg";
import p16_img from "./product-16.jpeg";

let data_product = [
  {
    id: 1,
    name: "Striped Flutter Sleeve Overlap Collar Peplum Hem Blouse",
    image: p13_img,
    new_price: 50.0,
    old_price: 80.5,
  },
  {
    id: 2,
    name: "Striped Flutter Sleeve Overlap Collar Peplum Hem Blouse",
    image: p14_img,
    new_price: 85.0,
    old_price: 120.5,
  },
  {
    id: 3,
    name: "Striped Flutter Sleeve Overlap Collar Peplum Hem Blouse",
    image: p15_img,
    new_price: 85.0,
    old_price: 120.5,
  },
  {
    id: 4,
    name: "Striped Flutter Sleeve Overlap Collar Peplum Hem Blouse",
    image: p16_img,
    new_price: 85.0,
    old_price: 120.5,
  },
];

export default data_product;
